import React from "react";

function SliderNumber({ activeSlide }: any) {
  return (
    <div
      style={{
        position: "absolute",
        zIndex: 3,
        right: 4,
        top: "15px",
        fontFamily: "Arial, Helvetica, sans-serif",
      }}
    >
      <span
        style={{
          height: "20px",
          width: "20px",
          backgroundColor: "rgba(255,255,255,0.6)",
          padding: "7px",
          borderRadius: "50%",
        }}
      >
        {" "}
        1/10{" "}
      </span>
    </div>
  );
}

export default SliderNumber;
